import React from 'react';
import Card from "../search_page/card";


class CitiesPage extends React.Component{
    constructor(props) {
        super(props);
        this.state = {
            cities: this.props.cities,
        }
    };

    render() {

        const {cities} = this.state;
        const buildSquareDetails = () => {
            return cities.map((item, i) => {
                return (
                    <Card {...item} cities={cities} key={i}/>
                )
            })
        };

        return(
            <div className={"container-grid"} id={"fourth_row"}>
                <h1 className={"titel_of_boxs"}>My Cities</h1>
                <div>
                    {buildSquareDetails()}
                </div>
            </div>
        )
    }
}

export default CitiesPage;
